import React from 'react';

const mapImage = require('../images/maps.png');

import '../styles/MapDisplay.css';

const MapDisplay = ({ location, zoomLevel }) => (
    <div className="map">
      <image src={mapImage}></image>
    </div>
  )

  export default MapDisplay;
